actionConfiguration.body:
() => {
  const vehicleData = appsmith.store['updateVehicleData'];
  if (!(vehicleData instanceof Object)) {
    return [];
  }
  var formattedDriverIds = [];
  for (var driverId of vehicleData.driverIds) {
    formattedDriverIds.push({
      "driverId": driverId
    });
  }
  return formattedDriverIds;
}

